import { IStoreState } from '../../_reducers';
import { Translation } from '../../models/models';
import { ObserverTest } from '../../components/ui/ObserverTest/ObserverTest';
import { InteractiveSvgMap } from '../../components/ui/InteractiveSvgMap/InteractiveSvgMap';
import { IS_MOBILE } from '../../config';

export interface ContentPageProps extends ReactRedux.DispatchProp<any>, RouteComponentProps<any> {
    className?: string;
    locale: Translation;
}

const INIT_STATE: ContentPageState = {
    current: ""
}

export interface ContentPageState {
    current: string;
}

export class ContentPage extends React.Component<ContentPageProps, ContentPageState> {
    el: any;
    constructor(props: ContentPageProps) {
        super(props);
        this.state = INIT_STATE;
    }

    handleStateChange = (current) => {
        this.setState({
            current
        })
    }

    render() {
        const { props, state } = this;
        const cls = this.props.className || "";

        //NEED TO WORK ON GETTING THE STATE FROM THE PARENT
        return (
            <div className={"content-page " + cls}>
                <InteractiveSvgMap
                    id={"europe"}
                    svgImg={testMap2}
                    isInteractive={!IS_MOBILE}
                    tooltip={
                        {
                            // height: 100,
                            // width: 100,
                            // top: 1,
                            // left: 1,
                            cursorBased: true,
                            element: <p className="map-tooltip__text">Im section: {state.current}</p>
                        }
                    }
                    eventType={'click'}
                    interChildCls={"st0"} //class of interactive elements in svg
                    // interParentId={"testMap2"} //id of svg
                    onStateChange={this.handleStateChange}
                    stylesMod={{
                        // object that holds the attribute to change, the value when enabled and disabled(relative to the type of the attribute e.g if color then will be a color string)
                        click: {
                            attr: "fill",
                            valueEnabled: "blue",
                            valueDisabled: "red",
                            valueDefault: "red"
                        },
                        mousemove: {
                            attr: "fill",
                            valueEnabled: "green",
                            valueDisabled: "red",
                            valueDefault: "red"
                        }
                    }}
                    customOnClick={() => console.log("11213")}
                />
                <h1>{"mainstate: " + state.current}</h1>
            </div>
        )
    }
}

const mapStateToProps = (state: IStoreState, ownProps): Partial<ContentPageProps> => {
    return {
        locale: state.app.locale
    }
}

const mapDispatchToProps = (dispatch: Dispatch) => bindActionCreators({
}, dispatch);

export default connect(mapStateToProps, mapDispatchToProps)(ContentPage);

